import React, {useState} from 'react';


function App() {
    const state = useState()

    let likes = 0;
    function increment() {
        likes += 1;
        console.log(likes);
    }

    function decrement() {
        likes -= 1;
        console.log(likes);
    }

  return (
    <div className="App">
        <h1>{likes}</h1>
        <button onClick={increment}>Increment</button>
        <button onClick={decrement}>Decrement</button>
    </div>
  );
}

export default App;
